import React, { Component } from 'react';
import axios from 'axios';
import Blog from './Blog/Blog'
import Nav from './Blog/Nav'

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null
    };
  }

  componentDidMount() {
    axios.get(process.env.REACT_APP_API_ENDPOINT+'/get-posts')
      .then(response => {
        this.setState({ data: response.data });
      })
      .catch(error => {
        console.error(error);
      });
  }

  render() {
    const { data } = this.state;

    return (
      <Router>
      <div>
        <Switch>
          <Route path="/navigate">
            <Nav />
          </Route>
          <Route path="/">
              {data ? (
              <Blog props={data}/>
              ) : (
                <p>Loading data...</p>
              )}
          </Route>
        </Switch>
      </div>
    </Router>

    );
  }
}

export default App;
